	.readdirSync(digdugPath)
	.filter(function(name) {
		return (
			/[A-Z]\w+Tunnel\.js$/.test(name) &&
			name !== 'NullTunnel.js' &&
			name !== 'Tunnel.js' &&
			name !== 'SeleniumTunnel.js'
		);
	})
	.map(function(name) {
		return name.slice(0, name.length - 3);
